import React from 'react'
import './style.scss'

import HeaderText from './HeaderText';

import scroll from './../../images/ic-'

 function Header() {
  return (
    <div className="header-container">
      <HeaderText />
      <img src={scroll} alt="scroll" />
    </div>
  )
}


export default Header;
